import { element } from 'prop-types';
import './App.css'; 
import Header from './components/Header';
import Movie from './components/Movie';
import movies from './movie.json'

function App() {

  return (
    <div className="App">
       <Header/>
       <div className='main'>
       {
        movies.map((element) => {
          return(
        <Movie 
        title ={element.Title} 
        year={element.Year}
        img={element.Poster}
        rating ={element.imdbID}
         />
          )
       })
       }
       </div>
    </div>

  );
}

export default App;
